"use strict";$(document).ready(function(){$(".searchButton").on("click",function(s){s.preventDefault();var a=$(".searchBar").val();$.ajax({url:"https://api.github.com/users/"+a}).done(function(s){$.ajax({url:"https://api.github.com/users/"+a+"/repos"}).done(function(s){var l="";$.each(s,function(s,a){l+="<li class='list-group-item'>"+a.name+"</li>"}),$(".repos-list").append(l)}),$(".github").html("\n         <div class='row'>\n           <div class='col-md-6 col-sm-12'>\n             <div class='card'>\n               <img class='card-img-top' src=\""+s.avatar_url+"\" alt=\"Card image cap\">\n                 <div class='card-body'>\n                   <h4 class='card-title'>"+s.name+"</h4>\n                   <p class='card-text'>"+s.bio+"</p>\n                   <a class='btn btn-dark btn-block' href=\""+s.html_url+"\" target=\"_blanck\">Github profile</a>\n                 </div>\n             </div>\n             </div>\n             <div class='col-md-6 col-sm-12'>\n               <ul class='list-group mb-2'>\n                 <li class='list-group-item list-group-item-primary'>Public repos: "+s.public_repos+"</li>\n               </ul>\n               <ul class='list-group repos-list'></ul>\n             </div>\n           </div>\n")})})});